ions, and a focus on the truly unfindable', '{"Ability to procure or create the truly unfindable","Custom sourcing for clients","Limited-edition collaborations","Discreet global shipping"}', 'luxury', 'The definitive source for statement pieces and bespoke oddities', 'A minimalist, geometric monogram or wordmark in monochrome, accented with iridescent or holographic details to evoke rarity and intrigue.', '{"Black","White","Silver","Iridescent/Holographic accent"}', '{"Minimalism with intrigue","Unexpected juxtapositions","Focus on negative space"}', 'Minimalist sans-serif with custom geometric letterforms', 'Clean, modern sans-serif for body text', NULL, 'Surreal, ethereal photography with negative space and unexpected juxtapositions', 'Futuristic, rarefied, and dreamlike', '{"Use monochrome backgrounds with iridescent highlights","Incorporate surreal, otherworldly elements","Maintain a sense of intrigue and exclusivity"}', 'active', DEFAULT, DEFAULT, 'https://example.com/brand8_logo.jpg');
